import { useState } from 'react';

// Define square component
function Square() {
  const [value, setValue] = useState(null);

  function handleClick() {
    setValue('X');
  }

  return (
    <button 
      className="square"
      onClick={handleClick}
    >
        {value}
    </button>
  );
}

// Use 'export' to make function accessible outside of this file
export default function Board() {
  // Create Component
  return (
    <>
